import React from 'react';

class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = { lat: 40 };
  }
  render(){
    window.navigator.geolocation.getCurrentPosition(
      position => console.log(position),
      err => console.log(err)
    );
    return(
      <div>Latitude:{this.state.lat} </div>
    )
  }
}

export default App;
